(function($){
    $.fn.extend({ 
        rotaterator: function(options) {
        var defaults = {fadeSpeed: 500, pauseSpeed: 100, child:null};
        var options = $.extend(defaults, options);
        return this.each(function() {
            var o =options;
            var obj = $(this);                
            var items = $(obj.children(), obj);
            items.each(function() {$(this).hide();})
            if(!o.child){
                var next = $(obj).children(':first');
            } else { 
                var next = o.child;
            }
            $(next).fadeIn(o.fadeSpeed, function() {
                $(next).delay(o.pauseSpeed).fadeOut(o.fadeSpeed, function() {
                    var next = $(this).next();
                    if (next.length == 0){
                        next = $(obj).children(':first');
                    }
                    $(obj).rotaterator({child : next, fadeSpeed : o.fadeSpeed, pauseSpeed : o.pauseSpeed});
                })
            });
        });
        }
    });
    $(document).ready(function() {$('#random_728_90').rotaterator({fadeSpeed:500, pauseSpeed:5000});});
    $(document).ready(function() {$('#random_468_60').rotaterator({fadeSpeed:500, pauseSpeed:5000});});
    $(document).ready(function() {$('#random_300_250').rotaterator({fadeSpeed:500, pauseSpeed:5000});});
    $(document).ready(function() {$('#random_320_50').rotaterator({fadeSpeed:500, pauseSpeed:5000});});
    $(document).ready(function() {$('#random_300_600').rotaterator({fadeSpeed:500, pauseSpeed:5000});});
})(jQuery);
var Site = (function () {
'use strict';

function _toConsumableArray(arr) { if (Array.isArray(arr)) { for (var i = 0, arr2 = Array(arr.length); i < arr.length; i++) { arr2[i] = arr[i]; } return arr2; } else { return Array.from(arr); } }
var IS_ACTIVE = 'is-active';
function noop() {}

function queryAll(context) {
    return function (selector) {
        return [].concat(_toConsumableArray(context.querySelectorAll(selector)));
    };
}

function exist(selector) {
    return new Promise(function (resolve, reject) {
        var elems = queryAll(document)(selector);
        if (elems.length) resolve(elems);
        reject('no element found for ' + selector);
    });
}

function toJqueryObject(elements) {
    return $(elements);
}

var accordionToggle = function () {
    exist('.js-accordion').then(toJqueryObject).then(function ($accordion) {
        $accordion.on('click', '.accordion-head', function (e) {
            var $this = $(e.currentTarget);
            var $thisTarget = $($this.data('collapse'));
            $thisTarget.siblings().removeClass(IS_ACTIVE);
            $thisTarget.toggleClass(IS_ACTIVE);
        });
    }).catch(noop);
};

var App = {accordionToggle: accordionToggle};

for (var fn in App) {
    if (fn[0] !== '_') App[fn]();
}
window.Site = App;
return App;}());
